int_openai_freq:"數值範圍介於 -2.0 和 2.0 之間。正值會根據該 token 在目前的文字中出現的頻率進行懲罰，減少模型產生重複內容的可能性。",com_endpoint_openai_pres:"數值範圍介於 -2.0 和 2.0 之間。正值會根據該 token 是否在目前的文字中出現來進行懲罰，增加模型談及新主題的可能性。",com_endpoint_openai_custom_name_placeholder:"為 ChatGPT 設定自定義名稱",com_endpoint_openai_prompt_prefix_placeholder:"在系統訊息中設定自定義提示。",com_endpoint_anthropic_temp:"範圍從 0 到 1。對於分析/多選題，使用接近 0 的溫度，對於創意和生成式任務，使用接近 1 的溫度。我們建議修改這個或 Top P，但不建議兩者都修改。",com_endpoint_anthropic_topp:"Top-p 改變模型選擇輸出 token 的方式。從最可能的 K（見 topK 參數）開始選擇 token，直到它們的機率之和達到 top-p 值。",com_endpoint_anthropic_topk:"Top-k 改變模型選擇輸出 token 的方式。Top-k 為 1 表示所選 token 在模型詞彙表中所有 token 中最可能（也稱為貪婪解碼），而 Top-k 為 3 表示下一個 token 從最可能的 3 個 token 中選擇（使用溫度）。",com_endpoint_anthropic_maxoutputtokens:"設定回應中可生成的最大 token 數。若希望回應簡短，請設定較低的數值；若需較長的回應，則設定較高的數值。",com_endpoint_anthropic_custom_name_placeholder:"為 Anthropic 設定自定義名稱",com_endpoint_frequency_penalty:"頻率懲罰",com_endpoint_presence_penalty:"出現懲罰",com_endpoint_plug_use_functions:"使用外掛作為 OpenAI 函式",com_endpoint_plug_skip_completion:"跳過完成步驟",com_endpoint_disabled_with_tools:"與工具一起停用",com_endpoint_disabled_with_tools_placeholder:"選擇工具時停用",com_endpoint_plug_set_custom_instructions_for_gpt_placeholder:"在系統訊息中新增自定義提示。",com_endpoint_import:"匯入",com_endpoint_set_custom_name:"設定自定義名稱，以便您找到此預設設定",com_endpoint_preset:"預設設定",com_endpoint_presets:"預設設定",com_endpoint_preset_name:"名稱",com_endpoint_new_topic:"新主題",com_endpoint:"選項",com_endpoint_hide:"隱藏",com_endpoint_show:"顯示",com_endpoint_examples:"預設設定",com_endpoint_completion:"完成",com_endpoint_agent:"代理",com_endpoint_show_what_settings:"顯示 {0} 設定",com_endpoint_save:"儲存",com_endpoint_export:"匯出",com_endpoint_save_as_preset:"另存為預設設定",com_endpoint_presets_clear_warning:"您確定要清除所有預設設定嗎？此操作無法復原。",com_endpoint_not_implemented:"尚未實做",com_endpoint_no_presets:"尚無預設設定",com_endpoint_not_available:"無可用選項",com_endpoint_view_options:"檢視選項",com_endpoint_save_convo_as_preset:"將對話另存為預設設定",com_endpoint_my_preset:"我的預設設定",com_endpoint_agent_model:"代理模型（建議：GPT-3.5）",com_endpoint_completion_mode